    "\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0076\u0069\u0022\u003e\u000a\u0020\u0020\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0022\u0055\u0054\u0046\u002d\u0038\u0022\u0020\u002f\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0064\u0065\u0076\u0069\u0063\u0065\u002d\u0077\u0069\u0064\u0074\u0068\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u002e\u0030\u0022\u0020\u002f\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u004d\u0045\u004e\u0055\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0073\u0074\u0079\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u002a\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0078\u002d\u0073\u0069\u007a\u0069\u006e\u0067\u003a\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0062\u006f\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u003a\u0020\u0030\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u006d\u0061\u0072\u0067\u0069\u006e\u003a\u0020\u0030\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0064\u0079\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0031\u0031\u0031\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0041\u0072\u0069\u0061\u006c\u002c\u0020\u0073\u0061\u006e\u0073\u002d\u0073\u0065\u0072\u0069\u0066\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0077\u0068\u0069\u0074\u0065\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u0066\u006c\u0065\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u006a\u0075\u0073\u0074\u0069\u0066\u0079\u002d\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003a\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0061\u006c\u0069\u0067\u006e\u002d\u0069\u0074\u0065\u006d\u0073\u003a\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0076\u0068\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u002e\u0063\u006f\u006e\u0074\u0061\u0069\u006e\u0065\u0072\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u006d\u0061\u0078\u002d\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0036\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0031\u0063\u0031\u0063\u0031\u0063\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0072\u0061\u0064\u0069\u0075\u0073\u003a\u0020\u0031\u0035\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u003a\u0020\u0031\u0035\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0078\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0020\u0030\u0020\u0030\u0020\u0031\u0035\u0070\u0078\u0020\u0072\u006 020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0061\u006c\u0065\u0072\u0074\u0028\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0022\u004b\u00ed\u0063\u0068\u0020\u0068\u006f\u1ea1\u0074\u0020\u0074\u0068\u00e0\u006e\u0068\u0020\u0063\u00f4\u006e\u0067\u0020\u0063\u1ea5\u0075\u0020\u0068\u00ec\u006e\u0068\u2705\u0020\uff08\u0020\u004c\u01b0\u0075\u0020\u00fd\u0020\u0063\u1ea5\u0075\u0020\u0068\u00ec\u006e\u0068\u0020\u0063\u0068\u1ec9\u0020\u006c\u00e0\u0020\u0064\u1ea1\u006e\u0067\u0020\u0068\u1ed7\u0020\u0074\u0072\u1ee3\u0020\u006b\u00e9\u006f\u0020\u0074\u00e2\u006d\u0020\u006e\u00ea\u006e\u0020\u0111\u1eeb\u006e\u0067\u0020\u0111\u00f2\u0069\u0020\u0068\u1ecf\u0069\u0020\u0071\u0075\u00e1\u0020\u0063\u0061\u006f\u0021\u0020\uff09\u0022\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0029\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u002f\u002f\u0020\u0054\u0068\u0061\u0079\u0020\u0111\u1ed5\u0069\u0020\u0068\u00ec\u006e\u0068\u0020\u1ea3\u006e\u0068\u0020\u0074\u0072\u006f\u006e\u0067\u0020\u006d\u0065\u006e\u0075\u0020\u0063\u0068\u00ed\u006e\u0068\u0020\u0062\u1eb1\u006e\u0067\u0020\u0055\u0052\u004c\u0020\u0074\u00f9\u0079\u0020\u0063\u0068\u1ecd\u006e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u006c\u0065\u0074\u0020\u006d\u0065\u006e\u0075\u0049\u006d\u0061\u0067\u0065\u0055\u0072\u006c\u0020\u003d\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0070\u006c\u0061\u0079\u002d\u006c\u0068\u002e\u0067\u006f\u006f\u0067\u006c\u0065\u0075\u0073\u0065\u0072\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002e\u0063\u006f\u006d\u002f\u0045\u0046\u004a\u0032\u0033\u0057\u0074\u0039\u0036\u0067\u0041\u0050\u0066\u004d\u0032\u0039\u0050\u0042\u0041\u0072\u0076\u0050\u0063\u0069\u002d\u0053\u006f\u0061\u0049\u0030\u0051\u0062\u0042\u0038\u0066\u004f\u0035\u0047\u0031\u0078\u0036\u0033\u004e\u004a\u0049\u0063\u007
